import React from 'react'
import styled from "styled-components";
import { Button } from '@mantine/core';

export const TaskButtonItem = (props, onClick) => {
  const { ButtonName } = props;
  const {Event} =onClick
  const Button_li = styled.li`
  list-style:none;
  padding-right:10px;
`;


  return (
    <Button_li>
      <Button size="xs" type="submit"  >{ButtonName}</Button>
      <button  type="submit" Event >{ButtonName}</button>
    </Button_li>

  )
}
